import PropTypes, { string } from 'prop-types'

const Seats = ({ seats}) => {
    return (
        <>
        { seats.map((seat) => (<button className='seat'>{ seat.pnr }</button>))}
        </>

    )
}

Button.propTypes = {
    text: PropTypes.string,
    color: PropTypes.string,
    onClick: PropTypes.func,
}

export default Seat
